import "./../styles/tutor-dash.css";
import CourseCard from "./course-card";
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import CardGroup from 'react-bootstrap/CardGroup';

function TutorDashCourses () {
  return (
    <>
      {/*<!-- Show card for each added course -->*/}


      <Container className="tutor-dash-courses">
        {/* CardGroup implementation */}
        {/*}
        <CardGroup>
          <CourseCard />
          <CourseCard />
          <CourseCard />
        </CardGroup>
        */}

        {/* Row + column implementation */}

        {/*}
        <Row>
          <Col>
            <CourseCard />
          </Col>
          <Col>
            <CourseCard />
          </Col>
          <Col>
            <CourseCard />
          </Col>
        </Row>
        {*/}
        <div class="calendly-inline-widget" data-url="https://calendly.com/brandon-dahl77?hide_landing_page_details=1"></div>
        <script type="text/javascript" src="https://assets.calendly.com/assets/external/widget.js"></script>

      </Container>
    </>
  )
}

export default TutorDashCourses;
